('2018-02-16 19:41:18', '0.7.01', 'atlantis', '1951422557', 'An incredibly wild mission based on the pursuit of the gateway\\nto the great city of Atlantis\\n\\nMaintained by Keith Sammut\\nhttps://github.com/KeithSammut', 'https://glest.dreamhosters.com/files/scenarios/atlantis.7z', 'https://glest.dreamhosters.com/files/scenarios/images/atlantis.png', 0, '1951422557'),
('2018-02-07 06:59:04', '0.7.01', 'island_survival', '1593026043', 'An alpha version of the Island Survival scenario of the game Glest.', 'https://glest.dreamhosters.com/files/scenarios/island_survival.7z', 'https://glest.dreamhosters.com/files/scenarios/images/island_survival.jpg', 0, '1593026043'),
('2018-02-26 20:00:00', '0.7.01', 'seventh_element', '2004710198', 'The Titans have sent\\nyou to defeat four demonic guardians and you must use your powers\\n and agility to defeat all four of them\\nand return the cursed treasure from their bases.\\n\\nMaintained by Keith Sammut\\nhttps://github.com/KeithSammut', 'https://glest.dreamhosters.com/files/scenarios/seventh_element.7z', 'https://glest.dreamhosters.com/files/scenarios/images/seventh_element.jpg', 0, '2004710198'),
